package com.mrkt.product.core;

import java.io.FileOutputStream;
import java.io.IOException;
import java.util.UUID;

//import org.apache.commons.io.FileUtils;
import org.junit.Test;
import org.springframework.util.Base64Utils;

import com.mrkt.constant.ResultEnum;
import com.mrkt.exception.MrktException;

/**
 * @ClassName	FileUploadTest
 * @Description
 * @author		hdonghong
 * @version 	v1.0
 * @since		2018/04/19 00:00:02
 */
public class FileUploadTest {

	@Test
	public void test() throws IOException {
		String base64Str = "data:image/jpeg;base64,";
		String [] base64Arr = base64Str.split("base64,");
		if (!(base64Arr != null && base64Arr.length == 2)) {
			//  TODO
			throw new MrktException(ResultEnum.UPLOAD_PICTRUE_FIAL);
		}
		String dataPrix = base64Arr[0];
		String data = base64Arr[1];
		String suffix = "";  
        if("data:image/jpeg;".equalsIgnoreCase(dataPrix)){//data:image/jpeg;base64,base64jpeg  
            suffix = ".jpg";  
        } else if("data:image/x-icon;".equalsIgnoreCase(dataPrix)){//data:image/x-icon;base64,base64icon  
            suffix = ".ico";  
        } else if("data:image/gif;".equalsIgnoreCase(dataPrix)){//data:image/gif;base64,base64gif  
            suffix = ".gif";  
        } else if("data:image/png;".equalsIgnoreCase(dataPrix)){//data:image/png;base64,base64png  
            suffix = ".png";  
        } else {
        	//  TODO
            throw new MrktException(ResultEnum.UPLOAD_PICTRUE_FIAL);  
        }
		
		byte[] bs = Base64Utils.decodeFromString(data);
		String randomName = UUID.randomUUID() + suffix;
		FileOutputStream fos = new FileOutputStream("D://image/" + randomName);
		fos.write(bs);
		fos.close();
	}
}
